import React from "react";

function PortfolioOne(props) {
  return (
    <figure className="figure">
      <a href={props.picture}>
        <img
          src={props.picture}
          className="figure-img img-fluid rounded shadow opacity"
          style={{
            boxShadow: "0 0 30px #44589072;",
            opacity
          }}
          alt="..."
        />
      </a>
      <a href={props.nav}>{props.title}</a>
    </figure>
  );
}

export default PortfolioOne;
